import React from 'react';
import './App.scss';

import Container from './components/Container';
import TodoContext from './context'

function App() {
  return (
    <TodoContext.Provider>
      <div className="app">
        <Container />
      </div>
    </TodoContext.Provider>
  );
}

export default App;
